import React from 'react';
import ReactDom from 'react-dom';
import Data from './Data.jsx'
import Html from './App'
import './index.css'






// App Netflix


ReactDom.render(
    <>
    <h1>Top Netflix Series</h1>

    {Data.forEach((data) => {
        return( <Html
         imgsrc = {data.imgsrc}
         title={data.title}
         link={data.link}
     />
    )})
}
    </>
    ,
    document.getElementById("root")
)


















